import React from 'react';
import { connect, useDispatch} from "react-redux";

import ConsoleButton from '../../components/ConsoleButton/ConsoleButton';

import {startGetRequestServer, windowOpen} from '../../store/serverViewType/actions/actionViewType';

function ContConsoleButton (props){
    
    const dispatch = useDispatch();
    
    const handlerClick = ()=>{
        console.log('click');
    }
    
    return(
        <div>
            <ConsoleButton
                classname = ""
                name1 = "Обновить"
                name2 = "Добавить"
                name3 = "Внести изменения"
                name4 = "Только активные"
                name5 = "Удалить"
                title1 = "Обновить"
                title2 = "Добавить"
                title3 = "Внести изменения"
                title4 = "Только активные"
                title5 = "Удалить"
                onclick1 = {()=>{ dispatch(startGetRequestServer())} }
                onclick2 = {()=>{ dispatch(windowOpen())}}
                onclick3 = {handlerClick}
                onclick4 = {handlerClick}
                onclick5 = {handlerClick}
                type = "button"
                tabindex = "-1"

                />
             
        </div>
    )
}

export default connect()(ContConsoleButton)
